import React from "react";

export default function Row({ wordLength, guess }) {
  return (
    <div className="row">
      {guess
        ? guess.map((l, i) => (
            <div key={i} className={l.color}>
              {l.key}
            </div>
          ))
        : Array.from({ length: wordLength }, (_, index) => (
            <div key={index}></div>
          ))}
    </div>
  );
}
